    [],nt"revision_timestamp": "2016-07-27T22:19:38.848094",nt"name": "census-of-trees-occurring-in-the-bat-net-region-of-walnut-creek-refuge",nt"isopen":
    false,nt"url": null,nt"notes": "Walnut Creek Wildlife Refuge is a government
    funded project attempting to restore 8000 acres of Iowa land to its original prairie
    form. A census of trees is needed in some areas of the refuge in order to determine
    which trees are native and which are foreign to prairie ecosystem. The trees that
    are native will be protected and their seeds collected while those that are foreign
    will be removed. However, a problem arises when bats, especially the endangered
     Indiana bats, roost in these areas. Those leading the project of restoring the
    prairie must take into account that an endangered species will be influenced by
    the removal of any trees, even foreign ones. Our goal is to record the various species
    and their numbers in the region of Walnut Creek where the bat nets are located.
    We expect to find a variety of species coexisting in the area with a large number
    of shagbark hickory.",nt"license_title": "License Not Specified",nt"extras":
